import React, { Component } from "react";
import { Nav, Navbar, NavbarBrand, NavLink, NavItem } from "reactstrap";
import { faHome } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon, FontAwesome } from "@fortawesome/react-fontawesome";
import { faWalking, faSwimmer } from "@fortawesome/free-solid-svg-icons";
export default class Navigation extends Component {
  render() {
    return (
      <div>
        <Navbar
          className="bg-light navbar-default   navbar-dark bg-dark"
          color="muted"
          light
          expand="md"
        >
          <NavbarBrand className="navbar-brand  mx-auto" href="/">
            Алатки за продуктивност{" "}
          </NavbarBrand>

          <Nav className="mx-auto" navbar>
            <NavItem>
              <NavLink href="/">
                <FontAwesome icon={faWalking} />
                Почетна
              </NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="/categories">Категории</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="/bills">Финансиски бележник</NavLink>
            </NavItem>

            <NavItem>
              <NavLink href="/todos">Todo</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="/user">Сметка</NavLink>
            </NavItem>
          </Nav>
        </Navbar>
      </div>
    );
  }
}
